import Keycloak from "keycloak-js";

let initOptions = {
  url: "http://localhost:8080/",
  realm: "bassure",
  clientId: "ats-react",
};
let keycloak = new Keycloak(initOptions);

keycloak.init({
  onLoad: "login-required",
});

const Log = () => {
  return <></>;
};

export default Log;
